import { AddEditBook } from "./AddEditBook/AddEdit";
import { Footer } from "./common/Footer";
function App() {
  return (
    <div className="App">
      <Routes>
        <Dashboard />

        <Footer />
      </Routes>
    </div>
  );
}

export default App;
